import React from "react";

function ProductDetail(props) {
  const { item } = props;

  return (
    <div>
      <h5>{item.item_name}</h5>
      <div>${item.price}</div>
      <select id="dropdown">
        <option value={item.sizes}>{item.sizes}</option>
      </select>
      <p>{item.description}</p>
    </div>
  );
}

export default ProductDetail;
